  selector: 'app-weight-graph',
  templateUrl: './weight-graph.component.html',
  styleUrls: ['./weight-graph.component.css']
})
export class WeightGraphComponent {
  public chart: any
}
<div class="chart-container">
    <canvas  id="MyChart" >{{ chart }}</canvas>
</div>
